// SPDX-License-Identifier: MIT
// Compatible with OpenZeppelin Contracts ^5.0.0
pragma solidity ^0.8.24;

import {IAccessControl} from "./IAccessControl.sol";
import {ModuleVersion} from '../IModule.sol';
import {LibRoles} from '../../libraries/LibRoles.sol';
import {IModuleRegistry} from '../../core/IModuleRegistry.sol';

struct AccessStorage {
    address owner;
    mapping(bytes32 => mapping(address => bool)) roles;
}

contract AccessModule is IAccessControl {

    IModuleRegistry public registry;
    bytes32 constant STORAGE_SLOT = keccak256(abi.encode(uint256(keccak256(bytes('xr.access.storage.v1'))) - 1)) & bytes32(uint256(0xff));
    string public constant override name = "IAccessControl";

    constructor(address r) {
        require(r != address(0), "AccessControl: cannot set registry to zero address");
        registry = IModuleRegistry(r);
    }

    function load() internal pure returns (AccessStorage storage a) {
        bytes32 slot = STORAGE_SLOT;
        assembly {
            a.slot := slot
        }
    }

    function version() external view virtual override returns (ModuleVersion memory) {
        return ModuleVersion(1, 0);
    }

    function owner() external view returns (address) {
        AccessStorage storage s = load();
        return s.owner;
    }

    function setOwner(address o) external {
        require(o != address(0), "AccessControl: cannot set owner to zero address");
        AccessStorage storage s = load();
        s.owner = o;
    }

    function hasRole(bytes32 role, address account) external view returns (bool) {
        AccessStorage storage s = load();
        bool b = s.roles[role][account];
        require(b, "AccessControl: role not granted");
        return b;
    }

    function grantRole(bytes32 role, address account) external {
        require(account != address(0), "AccessControl: cannot grant role to zero address");
        AccessStorage storage s = load();
        s.roles[role][account] = true;
        require(s.roles[role][account], "AccessControl: failed to grant role");
    }

    function revokeRole(bytes32 role, address account) external {
        require(account != address(0), "AccessControl: cannot revoke role from zero address");
        AccessStorage storage s = load();
        s.roles[role][account] = false;
    }

    function init(address o, address[] memory admins) external {
        AccessStorage storage s = load();
        require(o != address(0), "AccessControl: cannot set owner to zero address");
        s.roles[LibRoles.ROLE_OWNER][o] = true;
        s.roles[LibRoles.ROLE_ADMIN][o] = true; // owner is also admin
        s.owner = o;
        for (uint256 i = 0; i < admins.length; i++) {
            require(admins[i] != address(0), "AccessControl: cannot set admin to zero address");
            s.roles[LibRoles.ROLE_ADMIN][admins[i]] = true;
        }
    }

}

